"use client"

import { useState, useEffect } from "react"
import axios from "axios"
import { useAuth } from "../context/UserContext"

const TransporterDashboard = () => {
  const { user, logout } = useAuth()
  const [transportRequests, setTransportRequests] = useState([])
  const [myVehicles, setMyVehicles] = useState([])
  const [loading, setLoading] = useState(true)
  const [activeTab, setActiveTab] = useState("dashboard")
  const [newVehicle, setNewVehicle] = useState({
    name: "",
    type: "truck",
    capacity: "",
    rate_per_km: "",
    description: "",
    image: null,
  })

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Fetch available transport requests
        const requestsResponse = await axios.get("http://localhost:8000/api/transports/available_jobs/")
        setTransportRequests(requestsResponse.data)

        // Fetch transporter's vehicles
        const vehiclesResponse = await axios.get("http://localhost:8000/api/transports/my_vehicles/")
        setMyVehicles(vehiclesResponse.data)

        setLoading(false)
      } catch (error) {
        console.error("Error fetching transporter data:", error)
        setLoading(false)
      }
    }

    fetchData()
  }, [])

  const handleLogout = () => {
    logout()
  }

  const handleVehicleChange = (e) => {
    if (e.target.name === "image") {
      setNewVehicle({
        ...newVehicle,
        image: e.target.files[0],
      })
    } else {
      setNewVehicle({
        ...newVehicle,
        [e.target.name]: e.target.value,
      })
    }
  }

  const handleVehicleSubmit = async (e) => {
    e.preventDefault()

    const formData = new FormData()
    Object.keys(newVehicle).forEach((key) => {
      formData.append(key, newVehicle[key])
    })

    try {
      const response = await axios.post("http://localhost:8000/api/transports/vehicles/", formData, {
        headers: {
          "Content-Type": "multipart/form-data",
        },
      })

      setMyVehicles([...myVehicles, response.data])
      setNewVehicle({
        name: "",
        type: "truck",
        capacity: "",
        rate_per_km: "",
        description: "",
        image: null,
      })

      alert("Vehicle added successfully!")
    } catch (error) {
      console.error("Error adding vehicle:", error)
      alert("Failed to add vehicle. Please try again.")
    }
  }

  const handleAcceptRequest = async (requestId) => {
    try {
      await axios.post(`http://localhost:8000/api/transports/${requestId}/accept/`)

      // Update the local state to reflect the change
      setTransportRequests(
        transportRequests.map((request) =>
          request.id === requestId ? { ...request, status: "accepted", transporter: user.id } : request,
        ),
      )

      alert("Transport request accepted!")
    } catch (error) {
      console.error("Error accepting request:", error)
      alert("Failed to accept request. Please try again.")
    }
  }

  const handleRejectRequest = async (requestId) => {
    try {
      await axios.post(`http://localhost:8000/api/transports/${requestId}/reject/`)

      // Update the local state to reflect the change
      setTransportRequests(transportRequests.filter((request) => request.id !== requestId))

      alert("Transport request rejected!")
    } catch (error) {
      console.error("Error rejecting request:", error)
      alert("Failed to reject request. Please try again.")
    }
  }

  return (
    <div className="transporter-dashboard">
      <header className="dashboard-header">
        <h1>Transporter Dashboard</h1>
        <div className="user-info">
          <span>
            Welcome, {user.first_name} {user.last_name}
          </span>
          <button onClick={handleLogout} className="logout-btn">
            Logout
          </button>
        </div>
      </header>

      <div className="dashboard-nav">
        <button className={activeTab === "dashboard" ? "active" : ""} onClick={() => setActiveTab("dashboard")}>
          Dashboard
        </button>
        <button className={activeTab === "requests" ? "active" : ""} onClick={() => setActiveTab("requests")}>
          Transport Requests
        </button>
        <button className={activeTab === "vehicles" ? "active" : ""} onClick={() => setActiveTab("vehicles")}>
          My Vehicles
        </button>
      </div>

      <div className="dashboard-content">
        {loading ? (
          <p>Loading data...</p>
        ) : (
          <>
            {activeTab === "dashboard" && (
              <div className="dashboard-overview">
                <h2>Overview</h2>
                <div className="stats-grid">
                  <div className="stat-card">
                    <h3>Available Requests</h3>
                    <p className="stat-number">{transportRequests.filter((r) => r.status === "pending").length}</p>
                    <button onClick={() => setActiveTab("requests")}>View Requests</button>
                  </div>
                  <div className="stat-card">
                    <h3>My Vehicles</h3>
                    <p className="stat-number">{myVehicles.length}</p>
                    <button onClick={() => setActiveTab("vehicles")}>Manage Vehicles</button>
                  </div>
                  <div className="stat-card">
                    <h3>Accepted Jobs</h3>
                    <p className="stat-number">
                      {transportRequests.filter((r) => r.status === "accepted" && r.transporter === user.id).length}
                    </p>
                    <button onClick={() => setActiveTab("requests")}>View Jobs</button>
                  </div>
                </div>

                <div className="recent-activity">
                  <h3>Recent Activity</h3>
                  <div className="activity-list">
                    {transportRequests
                      .filter((r) => r.status === "accepted" && r.transporter === user.id)
                      .slice(0, 5)
                      .map((request) => (
                        <div key={request.id} className="activity-item">
                          <p>
                            Transport job accepted: {request.pickup_location} to {request.delivery_location}
                          </p>
                          <span className="activity-date">{new Date(request.created_at).toLocaleDateString()}</span>
                        </div>
                      ))}
                  </div>
                </div>
              </div>
            )}

            {activeTab === "requests" && (
              <div className="requests-section">
                <h2>Transport Requests</h2>
                <div className="requests-list">
                  {transportRequests.filter((r) => r.status === "pending").length > 0 ? (
                    transportRequests
                      .filter((r) => r.status === "pending")
                      .map((request) => (
                        <div key={request.id} className="request-item">
                          <div className="request-info">
                            <h3>Request #{request.id}</h3>
                            <p>
                              <strong>From:</strong> {request.pickup_location}
                            </p>
                            <p>
                              <strong>To:</strong> {request.delivery_location}
                            </p>
                            <p>
                              <strong>Cargo:</strong> {request.cargo_description}
                            </p>
                            <p>
                              <strong>Weight:</strong> {request.weight} kg
                            </p>
                            <p>
                              <strong>Pickup Date:</strong> {new Date(request.pickup_date).toLocaleString()}
                            </p>
                            <p>
                              <strong>Budget:</strong> ${request.budget}
                            </p>
                            <p>
                              <strong>Requester:</strong> {request.requester_details?.username || "Unknown"}
                            </p>
                          </div>
                          <div className="request-actions">
                            <button className="accept-btn" onClick={() => handleAcceptRequest(request.id)}>
                              Accept
                            </button>
                            <button className="reject-btn" onClick={() => handleRejectRequest(request.id)}>
                              Reject
                            </button>
                          </div>
                        </div>
                      ))
                  ) : (
                    <p>No pending transport requests available.</p>
                  )}
                </div>

                <h2>My Accepted Jobs</h2>
                <div className="jobs-list">
                  {transportRequests.filter((r) => r.status !== "pending" && r.transporter === user.id).length > 0 ? (
                    transportRequests
                      .filter((r) => r.status !== "pending" && r.transporter === user.id)
                      .map((job) => (
                        <div key={job.id} className="job-item">
                          <div className="job-info">
                            <h3>Job #{job.id}</h3>
                            <p>
                              <strong>From:</strong> {job.pickup_location}
                            </p>
                            <p>
                              <strong>To:</strong> {job.delivery_location}
                            </p>
                            <p>
                              <strong>Cargo:</strong> {job.cargo_description}
                            </p>
                            <p>
                              <strong>Weight:</strong> {job.weight} kg
                            </p>
                            <p>
                              <strong>Pickup Date:</strong> {new Date(job.pickup_date).toLocaleString()}
                            </p>
                            <p>
                              <strong>Status:</strong> <span className={`status-${job.status}`}>{job.status}</span>
                            </p>
                            <p>
                              <strong>Requester:</strong> {job.requester_details?.username || "Unknown"}
                            </p>
                          </div>
                          <div className="job-actions">
                            {job.status === "accepted" && <button className="start-btn">Start Job</button>}
                            {job.status === "in_progress" && <button className="complete-btn">Complete Job</button>}
                          </div>
                        </div>
                      ))
                  ) : (
                    <p>You haven't accepted any jobs yet.</p>
                  )}
                </div>
              </div>
            )}

            {activeTab === "vehicles" && (
              <div className="vehicles-section">
                <h2>My Vehicles</h2>
                <div className="vehicles-grid">
                  {myVehicles.length > 0 ? (
                    myVehicles.map((vehicle) => (
                      <div key={vehicle.id} className="vehicle-card">
                        <div className="vehicle-image">
                          {vehicle.image ? (
                            <img src={vehicle.image || "/placeholder.svg"} alt={vehicle.name} />
                          ) : (
                            <img src="/placeholder.svg?height=150&width=200" alt="Vehicle" />
                          )}
                        </div>
                        <div className="vehicle-details">
                          <h3>{vehicle.name}</h3>
                          <p>
                            <strong>Type:</strong> {vehicle.type}
                          </p>
                          <p>
                            <strong>Capacity:</strong> {vehicle.capacity} kg
                          </p>
                          <p>
                            <strong>Rate:</strong> ${vehicle.rate_per_km}/km
                          </p>
                          <p>{vehicle.description}</p>
                        </div>
                        <div className="vehicle-actions">
                          <button className="edit-btn">Edit</button>
                          <button className="delete-btn">Delete</button>
                        </div>
                      </div>
                    ))
                  ) : (
                    <p>You haven't added any vehicles yet.</p>
                  )}
                </div>

                <div className="add-vehicle-form">
                  <h2>Add New Vehicle</h2>
                  <form onSubmit={handleVehicleSubmit}>
                    <div className="form-group">
                      <label>Vehicle Name</label>
                      <input type="text" name="name" value={newVehicle.name} onChange={handleVehicleChange} required />
                    </div>

                    <div className="form-group">
                      <label>Vehicle Type</label>
                      <select name="type" value={newVehicle.type} onChange={handleVehicleChange} required>
                        <option value="truck">Truck</option>
                        <option value="van">Van</option>
                        <option value="pickup">Pickup</option>
                        <option value="refrigerated">Refrigerated Vehicle</option>
                      </select>
                    </div>

                    <div className="form-row">
                      <div className="form-group">
                        <label>Capacity (kg)</label>
                        <input
                          type="number"
                          name="capacity"
                          value={newVehicle.capacity}
                          onChange={handleVehicleChange}
                          required
                        />
                      </div>

                      <div className="form-group">
                        <label>Rate per km ($)</label>
                        <input
                          type="number"
                          step="0.01"
                          name="rate_per_km"
                          value={newVehicle.rate_per_km}
                          onChange={handleVehicleChange}
                          required
                        />
                      </div>
                    </div>

                    <div className="form-group">
                      <label>Description</label>
                      <textarea
                        name="description"
                        value={newVehicle.description}
                        onChange={handleVehicleChange}
                        rows="3"
                      ></textarea>
                    </div>

                    <div className="form-group">
                      <label>Vehicle Image</label>
                      <input type="file" name="image" onChange={handleVehicleChange} accept="image/*" />
                    </div>

                    <button type="submit" className="submit-btn">
                      Add Vehicle
                    </button>
                  </form>
                </div>
              </div>
            )}
          </>
        )}
      </div>
    </div>
  )
}

export default TransporterDashboard
